class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        s_start = t_start = 0
        while s_start < len(s) and t_start < len(t):
            if s[s_start] == t[t_start]:
                s_start += 1
            t_start += 1
        return s_start == len(s)


print(
    Solution().isSubsequence(
        s="leeeeetcode",
        t="",
    ),
)
